import React from 'react';
import './appcss.css';
import {  Link } from 'react-router-dom';
import {rootConstants} from '../_constants';
import { connect } from 'react-redux';

const A = 65 ;
class classScreen extends React.Component {

    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
        this.state = {
          justClicked: null,
          letters: ["b","v"] 
        };
      }

      handleClick(letter) {
        this.setState({ justClicked: letter });
      }

      render() {
        return (
          <div>
            Just clicked: {this.state.justClicked}
            <ul>
              {this.state.letters.map(letter =>
                <li key={letter} onClick={() => this.handleClick(letter)}>
                  <p className={letter}>{letter}</p>
                </li>
              )}
            </ul>
            <button >sdfsdfsd</button>
          </div>
        )
      }
}
function mapStateToProps(state) {
  return {
     lessonData: state.lessonData,
     counter: state.counter,
     islog: state.islog,
     Reqislog: state.Reqislog,
     graphLessonName: state.graphLessonName,
     graphLessonData: state.graphLessonData
  }
}
function mapDispatchToProps(dispatch) {
  return {
      increaseCounter: () => dispatch({type: rootConstants.ROOT_REQUEST }),
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(classScreen);
